function generatePlaceholderURL() {
  const baseUrl = "https://placehold.co/";
  const width = components.width.value;
  const height = components.height.value;
  const sizeParam = `${width}x${height}`;
  const bgColorParam = components.bgColor.selectedColorHex.replace("#", "");
  const textColorParam = components.txtColor.selectedColorHex.replace("#", "");
  const formatParam = components.format.value;
  const textParam = components.custom.value;
  let imageUrl = `${baseUrl}${sizeParam}/${bgColorParam}/${textColorParam}/${formatParam}`;
  if (textParam) {
    imageUrl += `?text=${encodeURIComponent(textParam)}`;
    }
    return imageUrl;
  }
