function downloadImageFromURL(url, filename = 'image') {
  const validExtensions = ['png', 'jpg', 'gif', 'svg'];
  const fileExtension = filename.split('.').pop().toLowerCase();
  if (!validExtensions.includes(fileExtension)) {
    console.error('Invalid file format. Supported formats are: png, jpg, gif, svg.');
    throw new Error('Invalid file format. Please use a supported image format.');
  }
  fetch(url)
    .then(response => response.blob())
    .then(blob => {
      const blobUrl = URL.createObjectURL(blob);
      const link = document.createElement('a');
      link.href = blobUrl;
      link.download = filename;
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);
      URL.revokeObjectURL(blobUrl);
      })
    .catch(error => {
      console.error('Error downloading the image:', error);
      });
  }
